window.bookSummaryJSON = "<p>What do you get when you cross a cursed bookshop, three hot fictional men, and a punk rock heroine nursing a broken heart? </p> <p>After being fired from her fashion internship in New York City, Mina Wilde decides it's time to reevaluate her life. She returns to the quaint English village where she grew up to take a job at the local bookshop, hoping that being surrounded by great literature will help her heal from a devastating blow. </p> <p>But Mina soon discovers her life is stranger than fiction - a mysterious curse on the bookshop brings fictional characters to life in lust-worthy bodies. Mina finds herself babysitting Poe's raven, making hot dogs for Heathcliff, and getting IT help from James Moriarty, all while trying not to fall for the three broken men who should only exist within her imagination. </p> <p>When Mina's ex-best friend shows up dead with a knife in her back, she's the chief suspect. She'll have to solve the murder if she wants to clear her name. Will her fictional boyfriends be able to keep her out of prison? </p> <p>Contains mature themes.</p>"; 
